const Footer = () => {
    return (
        <footer className="navbar-fixed-bottom" bg="primary" text="white" variant="dark"  className="mt-3">
        <div className="container">
            <div className="row">
                <p>Don't miss my site: <a href="www.devbutze.com">DevButze</a> </p>
            </div>
        </div>
    </footer>
    );
  }

export default Footer;
